INSERT INTO `contrats` VALUES (3,'Entreprise','# CPNV - Complément au contrat de formation\r\n\r\n### Annexe à la Directive DS-ES-11 – Stage de pratique professionnelle en entreprise\r\n\r\n**Nom de l\'{{apprenti | apprentie}}** : {train_PrenomPersonne} {train_NomPersonne}\r\n\r\n**Adresse** : {train_Adresse1} {train_Adresse2}, {train_NPA}, {train_Localite}\r\n\r\n**IBAN** : .........\r\n\r\n**Profession et année d’apprentissage** : .........\r\n\r\n## Engagement pour un stage pratique en entreprise\r\n\r\nL’entreprise : {corp_NomEntreprise} - {corp_Adresse1} {corp_Adresse2}, {corp_NPA}, {corp_Localite} - s\'engage à atteindre au terme du stage pratique du {Debut} au {Fin} tous les objectifs définis par le programme de stage (défini d\'un commun accord entre les partenaires concernés) et autorise l’école à effectuer les visites de stages prévues. Si les conditions de stage définies d\'un commun accord entre les différents partenaires ne sont pas remplies, l’école se réserve le droit de rompre le présent contrat. A la fin du stage, l\'entreprise s\'engage à fournir un certificat de travail attestation de stage.\r\n\r\nNom de la personne responsable du stage : {resp_PrenomPersonne} {resp_NomPersonne}\r\n\r\n**Temps d\'essai** : les quatre premières semaines de stage sont considérées comme temps d\'essai, durant lequel l’employeur et l’Ecole (cette dernière avec le consentement du-de la représentant-e légal-e de l’{{apprenti | apprentie}}) peuvent résilier l\'engagement, sans indemnité, moyennant avis donné par écrit au moins trois jours à l\'avance.\r\n\r\n**Durée du travail** : la durée du travail est dans la règle de 42,5 heures par semaine. Elle ne doit pas dépasser celle des ouvriers et employés de l\'établissement ou, à défaut, la durée du travail fixée par l\'usage local.\r\n\r\n**Vacances** : {{le | la}} stagiaire a droit au nombre de jours de vacances prévu par le règlement de l’entreprise de stage, proportionnellement à la durée de celui-ci. Ces jours ne peuvent être pris durant les deux dernières semaines du stage.\r\n\r\n**Salaire** : en compensation  du travail fourni par {{le | la}} stagiaire, l\'entreprise versera {{au | à la}} stagiaire une rémunération de CHF {SalaireBrut} par mois, moins les charges sociales usuelles.\r\n\r\n**Assurance** : {{le | la}} stagiaire doit être {{déclaré | déclarée}} par les soins de l\'entreprise qui l\'engage à la caisse nationale en cas d\'accidents (SUVA).\r\n\r\n**Confidentialité** : {{le | la}} stagiaire s\'engage à ne pas photocopier et à ne pas sortir des documents internes à l\'entreprise, sans accord préalable de cette dernière.\r\n\r\n**Dispositions particulières** :\r\n\r\n - Pour les cas non prévus dans cet engagement, les dispositions du contrat et celles de la loi cantonale sur la formation professionnelle s\'y rapportant seront appliquées.\r\n\r\n - Les modalités pour la gestion des absences {{du | de la}} stagiaire et de l’évaluation du stage sont précisées dans le document annexé.\r\n\r\nAinsi fait, en trois exemplaires originaux, à Sainte-Croix, le {date}\r\n\r\nL\'entreprise :\r\n\r\nLa direction de l\'école (Représentant la DGEP):\r\n\r\nLe-la représentant-e légal-e {{du | de la}} stagiaire :\r\n\r\n{{Le | La}} stagiaire :'),(4,'Etat de Vaud','# CPNV - Complément au contrat de formation\r\n\r\n### Annexe à la Directive DS-ES-12 – Stage de pratique professionnelle dans l’ACV\r\n\r\n**Nom de l\'{{apprenti | apprentie}}** : {train_PrenomPersonne} {train_NomPersonne}\r\n\r\n**Adresse** : {train_Adresse1} {train_Adresse2}, {train_NPA}, {train_Localite}\r\n\r\n**N°CCP / N°compte bancaire** : .........\r\n\r\n**Profession et année d’apprentissage** : .........\r\n\r\n## Engagement pour un stage pratique dans l’administration cantonale vaudoise (ACV)\r\n\r\nLe service administratif : {corp_NomEntreprise} - {corp_Adresse1} {corp_Adresse2}, {corp_NPA}, {corp_Localite}\r\n\r\ns\'engage à atteindre au terme du stage pratique, du {Debut} au {Fin}.\r\n\r\ntous les objectifs définis par le programme de stage (défini d\'un commun accord entre les partenaires concernés) et autorise le CPNV à effectuer les visites de stages prévues. Si les conditions de stage définies d\'un commun accord entre les différents partenaires ne sont pas remplies, le CPNV se réserve le droit de rompre le présent contrat. A la fin du stage, l\'entreprise s\'engage à fournir une attestation de stage.\r\n\r\nNom de la personne responsable du stage : {resp_PrenomPersonne} {resp_NomPersonne}\r\n\r\n**Temps d\'essai** : les quatre premières semaines de stage sont considérées comme temps d\'essai, durant lequel l’employeur et l’Ecole (cette dernière avec le consentement du-de la représentant-e légal-e de l’{{apprenti | apprentie}}) peuvent résilier l\'engagement, sans indemnité, moyennant avis donné par écrit au moins trois jours à l\'avance.\r\n\r\n**Durée du travail** : la durée du travail est dans la règle de 41,5 heures par semaine. Elle ne doit pas dépasser celle des ouvriers et employés de l\'établissement ou, à défaut, la durée du travail fixée par l\'usage local.\r\n\r\n**Vacances** : d\'entente entre l\'employeur, le CPNV, et {{le | la}} stagiaire, {{ce  dernier | cette dernière}} a droit à 25 jours ouvrables de vacances années, calculés au prorata des mois de stage pratique. Ces jours ne peuvent être pris durant les deux dernières semaines du stage.\r\n\r\n**Salaire** : en compensation  du travail fourni par {{le | la}} stagiaire, l\'entreprise versera {{au | à la}} stagiaire une rémunération de CHF {SalaireBrut} par mois, moins les charges sociales usuelles.\r\n\r\n**Assurance** : {{le | la}} stagiaire doit être {{déclaré | déclarée}} par les soins de l\'entreprise qui l\'engage à la caisse nationale en cas d\'accidents (SUVA).\r\n\r\n**Confidentialité** : {{le | la}} stagiaire s\'engage à ne pas photocopier et à ne pas sortir des documents internes à l\'entreprise, sans accord préalable de cette dernière.\r\n\r\n**Dispositions particulières** :\r\n\r\na.pour les cas non prévus dans cet engagement, les dispositions du contrat et celles de la loi cantonale sur la formation professionnelle s\'y rapportant seront appliquées.\r\n\r\nb.les modalités pour la gestion des absences {{du | de la}} stagiaire et de l’évaluation du stage sont précisées dans le document annexé.\r\n\r\nAinsi fait, en trois exemplaires originaux, à Sainte-Croix, le {date}\r\n\r\nL\'entreprise :\r\n\r\nLa direction de l\'école (Représentant la DGEP):\r\n	\r\nLe-la représentant-e légal-e {{du | de la}} stagiaire :\r\n\r\n{{Le | La}} stagiaire :	\r\n');
/*!40000 ALTER TABLE `contrats` ENABLE KEYS */;
UNLOCK TABLES;

