onner un style littéraire à mon journal de bord, diminuant ainsi l\'efficacité de celui-ci. Vous perdez du temps à lire ces lignes, je perds du temps à les écrire, mais qu\'est-ce que je m\'amuse! Mes doigts frappent les touches du clavier dans une fiévreuse frénésie, alors que mes pensées s\'écoulent dans mes mots. \"La plume est plus forte que l\'épée\", scandait Victor Hugo, bien loin de se douter que celle-ci allait se faire remplacer par un amas de silicone, de plastique et de cuivre quelques décennies plus tard. Quel plaisir d\'utiliser inutilement quelques kilobytes de données, alors que ceux-ci pourraient être investis dans des desseins plus nobles. Alors que je bois les caractères a la source, je me rends compte que celle-ci tientpeut être plus de la corne d\'abondance que de la simple nappe phréatique. Tel un colon découvrant le nouveau monde, j\'en viens à me demander si un jour j\'en atteindrai le bout, et suis pris d\'une terrible interrogation: ne me serais-je pas lancé dans une tâche qui me dépasse? Est-ce que taper du texte sans aucun autre but que de repousser les limites du faisable ne serait pas sans aucun sens, étant donné que celles-ci ne seraient pas humainement atteignables? Mais tel le colon, je fais fi de mes inquiétudes, et me plonge dans l\'inconnu! Me reste-t-il assez de place pour finir cette phrase? Ou est-ce que je viens d\'écrire l\'équivalent d\'une goutte d\'eau dans un océan?',1),(3740,348,'2017-03-01 00:00:00',4,'Visite du site de St-Roch',8),(3741,348,'2017-02-28 12:00:00',1,'Guichet helpdesk',1),(3742,348,'2017-03-01 12:00:00',1,'Guichet helpdesk',2),(3743,348,'2017-03-01 12:00:00',2,'Installation de windows 7 sur un Lenovo X230',1),(3744,348,'2017-02-28 12:00:00',3,'Résolution d\'un problème d\'outlook sur un lenovo',2),(3745,348,'2017-03-01 12:00:00',1,'Check des imprimantes',1),(3746,356,'2017-03-01 12:00:00',0.5,'Entrée inutile pour dire que je suis déçu du nombre maximum de caractères, et que je propose que la nouvelle limi