le système de ticket, par qui passé pour certains type de problème, comment build une machine, comment mettre a jour l\'inventaire sur Asset Manager.',7),(10419,383,'2017-09-01 00:00:00',8,'J\'ai passé ma première journée à me familiariser avec l\'environnement et ma mission dans l\'entreprise. Une personne de l\'équipe du nom de Nicolas travaillera avec moi durant tout le stage car mon but est de l\'aider dans les migrations des PCs de W7 à W10. Il m\'a donc montré les salles dont lequels je vais devoir bidouiller et installer, les documentations etc... C\'était une journée découverte assez sympathique. Le boulot demandé à l\'air assez chargé mais simple. Je n\'ai pas grand chose à dire sur cette journée vu que c\'est une journée découverte mais j\'écris cette phrase pour éviter la case jaune.',8),(10420,383,'2017-09-04 00:00:00',8,'Je passe la journée à Nestlé Vevey pour le Welcome Day. ',11),(10424,382,'2017-08-29 00:00:00',0,'A remplir',7),(10425,382,'2017-08-30 00:00:00',0,'A remplir',7),(10426,382,'2017-08-31 00:00:00',0,'A remplir',7),(10433,366,'2017-08-31 00:00:00',0,'A remplir',7),(10439,368,'2017-08-29 00:00:00',0,'A remplir',7),(10440,368,'2017-08-30 00:00:00',0,'A remplir',7),(10441,368,'2017-08-31 00:00:00',0,'A remplir',7),(10444,388,'2017-09-01 00:00:00',6.5,'Visite de tout le bâtiment de Renens. Présentation aux collaborateurs de gymnase.',7),(10445,388,'2017-09-04 00:00:00',2,'Présentation du bâtiment du Gymnase de Provence. Connaissance des nouveaux collaborateurs.',7),(10446,388,'2017-09-01 12:00:00',0.5,'J\'ai été faire ma première intervention dans une salle de classe. Une prof a appelé en disant qu\'elle n\'arrivait pas à faire sortir le son sur les haut-parleurs de la salle. Je suis donc allé voir ce qu\'il se passait dans la salle et je me suis aperçu que la source de sortie des haut-parleurs était fausse. De plus j\'ai remarqué que le beamer n\'affichait pas ce qui était à l\'écran de l\'ordinateur. En cherchant un peu j\'ai vu que le câble