ne section au formulaire afin qu’elle soit complétée par un acteur du Workflow. La section change selon les options sélection dans le formulaire. Cela m’a pris du temps pour tester correctement les valeurs du bouton radio et afficher la bonne section. La gestion des règles des deux boutons c’est assez simplement du fait que j’avais les idées clair grâce au travail précédemment effectué. ',5),(12952,407,'2017-10-17 00:00:00',8,'Nous avons eu une conférence avec une personne responsable du projet afin de lui poser quelques questions sur certaines parties du formulaire. J’ai ensuite entrepris les modifications du formulaire selon les directives. Nous avons aussi contacté une équipe de développement en inde pour quelle nous fournissent de nouvelles informations dans un Web service qu’ils nous ont fourni. J’ai été victime de quelques bugs et malheureusement le Web service est tombé et l’équipe de développement n’étais pas là car il y avait une fête religieuse.',5),(12953,407,'2017-10-18 00:00:00',8,'Le Web service n’est toujours pas fonctionnel, je suis donc tourné vers la refactorisation de certaines règles du formulaire. Certaines règles n’étaient plus d’actualité et d’autres étaient des doublons. J’ai repéré les règles qui se répétaient beaucoup à diverses étapes du formulaire, puis j’ai créé une règle globale que j’ai appelée aux endroits voulus. J’ai aussi amélioré l’aspect graphique et le positionnement des boutons du formulaire. J’ai ensuite fait une mini démo à mon responsable et il m’a demandé de faire deux trois petits changements. ',5),(12954,407,'2017-10-19 00:00:00',8,'Kévin étant parti en vacances pendant quelques jours, et étant donné que mon projet arrivait gentiment à therme et que nous attendions toujours le rétablissement du web service par les indiens, ils m’ont demandé de reprendre le projet à Kevin. Je me suis donc renseigné sur le projet à travers un document Excel qui contenait les informations du projet ainsi que le workflow à réaliser. Dans un premier temps je me suis concentré sur l’avancement du workflow le l’initialisation des variables.    \r\n\r\n',5),(12955,407,'2017-10-20 00:00:00',8,'Continuation du nouveau projet en cours. Poursuite de l’avancement du workflow. Ce Workflow est n’est pas plus compliqué que le précédent que j’ai effectué mais il est plus long et possède plus d’action et plus de process en parallèle. La plupart des étapes sont des étapes de Validation par un acteur du Workflow ou des notifications par emails. J’ai quand même passé un certain temps sur le chargement des données utilisées au début et au démarrage du Workflow et pour la suite.                                                \r\n\r\n\r\n',5),(12956,407,'2017-10-23 00:00:00',8,'Continuation du nouveau projet en cours. Poursuite de l’avancement du workflow. Etant donné le nombre d’actions de validation, j’ai dû créer un état pour chaque étape de validation. J’ai dû en faire environ une quinzaine. Cette partie ne posa pas particulièrement de problèmes majeurs hormis quand un état semblait être buggé car j’ai eu un message d’erreur m’informant que cet état n’existait pas alors qu’il était créé. J’ai donc supprimé l’état buggé puis je l’ai créé de nouveau et tout fonctionna.   ',5),(12957,383,'2017-10-23 00:00:00',8,'Vacances',11),(12958,395,'2017-10-05 00:00:00',0,'A remplir',7),(12959,395,'2017-10-06 00:00:00',0,'A remplir',7),(12960,395,'2017-10-09 00:00:00',0,'A remplir',7),(12961,395,'2017-10-10 00:00:00',0,'A remplir',7),(12962,395,'2017-10-11 00:00:00',0,'A remplir',7),(12963,395,'2017-10-12 00:00:00',0,'A remplir',7),(12964,395,'2017-10-13 00:00:00',0,'A remplir',7),(12965,395,'2017-10-16 00:00:00',0,'A remplir',7),(12966,395,'2017-10-17 00:00:00',0,'A remplir',7),(12967,395,'2017-10-18 00:00:00',0,'A remplir',7),(12968,395,'2017-10-19 00:00:00',0,'A remplir',7),(12969,395,'2017-10-20 00:00:00',0,'A remplir',7),(12970,395,'2017-10-23 00:00:00',0,'A remplir',7),(12971,398,'2017-10-18 00:00:00',0,'A remplir',7),(12972,39