0',1.5,'Essayer de dépanner la machines Charmilles Robofill',9),(14207,424,'2017-11-17 00:00:00',2,'bug avec autovue de oracle qui ne se lançais pas j\'ai essayé de lancer un réparation logiciel mais au lieu de ça il c\'est supprimé. j\'ai donc réinstaller complètement et ça a fini par fonctionner',2),(14208,399,'2017-11-15 12:00:00',1,'Aider un élève pour le C#, il arrive bientôt au bout, son rubik\'s cube peut déjà être résolu à 75%, je l\'ai seulement aidé en tant que renseignement, je lui ai montré comment fonctionnait les fonctions, comment on pouvait gérer une chaîne de caractères ou comment écrire/modifier/traiter/supprimer des données sur des fichiers textes et comment gérer des chaînes de caractères dans des variables/tableaux',2),(14209,424,'2017-11-16 12:00:00',8,'Journée crystal report Nous avons essayé d\'avancer le devis et les confirmations mais ça n\'as pas été très concluant à cause des liaisons dans la base de donnée qui n\'ont peux être pas été correctement fait à la fin de la journée j\'avais une page qui sortait 30 fois une tête d\'extrusion. On a aussi eu de la peine parce que la mise en page est déjà pré faite depuis un autre report mais le copier collé ça ne fonctionne vraiment pas et un a perdu un temps fou à essayer de l\'adapter.',7),(14210,424,'2017-11-17 12:00:00',0.5,'installation du raspberry pi et du scanner dans la salle de présentation.',9),(14211,399,'2017-11-17 12:00:00',0.5,'Juger le temps qu\'il me faudra pour terminer mon projet portes ouvertes, je n\'y ai pas retoucher depuis presque 2 mois et le jour J se rapproche. (estimation 4h sans prendre compte de -> \"Il faut toujours plus de temps que prévu, même en tenant compte de la Loi de Hofstadter\")',7),(14212,424,'2017-11-17 12:00:00',2.5,'création d\'un cahier de charge pour la création d\'un facture et de facture d’acompte sur crystal report',3),(14213,399,'2017-11-17 12:00:00',0.5,'Ecriture du journal de bord, je n\'ai pas eu le temps mercredi et jeudi, j\'ai constamment été appelé et surchargé',3),(14214,424,'2017-11-17 12:00:00',1,'dépannage d\'un collègue pour un logiciel de la suite alphacam. j\'ai fini par envoyer un mail au support de la suite de logiciel.',2),(14215,399,'2017-11-16 12:00:00',0.5,'Préparer le bureau afin de commencer la préparation de PC en masse.',7),(14216,424,'2017-11-10 12:00:00',2,'rangement de feuille + création de classeurs pour optimisé le rangement.',3),(14217,399,'2017-11-16 12:00:00',1,'Modification de la sécurité des casques, la sécurité est nuisible au bon fonctionnement du casque',9),(14218,399,'2017-11-16 12:00:00',0.5,'Montrer le travail qui à été fait à mon supérieur',7),(14219,424,'2017-11-10 12:00:00',1.5,'dépannage d\'un utilisateur sur la graveuse qui avait perdu un fichier.',2),(14220,399,'2017-11-16 12:00:00',2,'Mail + téléphone avec swisscom, concernant les anomalies qui viennent constamment sur nos serveurs.',7),(14221,399,'2017-11-16 12:00:00',0.5,'Déplacer la grande TV pour le salon des métiers. Au final on ne pourra pas la prendre par manque de place sur le stand au salon des métiers.',9),(14222,389,'2017-11-17 12:00:00',1.5,'E-commerce<hr/>\r\nAjout des mac book pro au shop.<br/>\r\nTous ceux de 2009 ont une petite différence donc il faut une variante pour chaque.',7),(14223,389,'2017-11-17 12:00:00',1,'Helpdesk<hr/>\r\nrefaire l\'ordre des articles sur la page principale du shop.',2),(14224,388,'2017-11-17 12:00:00',1,'J\'ai emménagé le nouveau chariot et j\'ai mis tous les ordinateur qui devaient aller dedans. J\'ai mis toutes les prises d\'alimentation, le petit boitier pour le wifi et j\'ai fourni un câble Ethernet pour le brancher à une prise. ',1),(14225,399,'2017-11-16 12:00:00',1,'Dépannages d\'applications',9),(14226,388,'2017-11-17 12:00:00',0.5,'J\'ai créé un compte pour un nouveau professeur (M. Pascal Auchlin), je lui ai envoyé les informations sur sa boîte mail. ',7),(14227,388,'2017-11-17 12:00:00',0.5,'J\'ai été dans deux salles parce qu\'il y avait des problèmes. Dans la salle 214 le problème que le prof a signalé au secrétariat était qu\'il y avait un problème d\'affichage entre le beamer et l\'ordinateur. Ce que j\'ai vu c\'est qu\'entre l\'ordinateur et le beamer ils étaient pas en recopie d\'écran dans les préférences système de la machine. En 215 j\'ai dû remettre droit le beamer parce que l\'affichage était trop bas.',1),(14228,388,'2017-11-17 12:00:00',1,'Une prof (Mme. Pauline Délez) nous a dit qu\'un logiciel qui était installé sur les ordinateurs administratifs en salle des maîtres ne fonctionnait pas sur un ordinateur sur 2. Je me suis connecté dessus en mettant plusieurs identifiants que je connais mais aucuns n\'a fonctionné. J\'ai envoyé un mail à la responsable du logiciel pour voir ce que je dois faire.',1),(14229,383,'2017-11-14 00:00:00',1,'Monthly meeting avec l\'équipe qui a duré 1 heure.',4),(14230,383,'2017-11-15 00:00:00',2,'Jorge m\'a demandé de vérifier le stock total qu\'on avait. J\'ai donc dû me rendre dans une salle où se trouve le reste du stock et vérifier se qu\'on avait. Après ça, j\'ai dû faire un petit rapport à Jorge pour qu\'il sache ce qu\'il faut commander.',7),(14231,383,'2017-11-16 00:00:00',1,'Weekly meeting de l\'équipe. ',4),(14232,383,'2017-11-17 00:00:00',3,'J\'ai dû assister un technicien qui était venu installer un logiciel sur le PC d\'un utilisateur (je devais installer le pc/donner les droits admins).',9),(14233,383,'2017-11-17 12:00:00',2,'J\'ai lancé des builds et j\'ai revu un peu le stock qu\'on avait pour les builds.',7),(14234,383,'2017-11-13 12:00:00',6.5,'J\'ai passé la journée à faire la documentation des Webapps. ',3),(14235,383,'2017-11-14 12:00:00',1,'J\'avais ouvert des tickets pour les bswiss la semaine passle et la personne qui s\'en occupe m\'as contacté pour vérifier si tout était bon. J\'ai dû un peu modifier les configurations pour que ça marche.',7),(14236,383,'2017-11-14 12:00:00',0.5,'J\'ai bougé la dernière imprimante avec Sylvain.',7),(14237,383,'2017-11-14 12:00:00',1,'J\'ai fait une migration chez un utilisateur. L\'installation était basique, je n\'ai pas eu de grande difficulté.',9),(14238,383,'2017-11-14 12:00:00',3.5,'J\'ai repris un peu de la documentation pour le reste de la journée.',3),(14239,383,'2017-11-15 12:00:00',1,'J\'ai dû faire une migration d\'un utilisateur qui n\'était pas là. J\'ai donc demandé à un autre utilisateur de vérifier. Il fallait activer le logiciel mais j\'ai pu le faire facilement. Autrement, rien de spécial.',7),(14240,383,'2017-11-13 12:00:00',1,'J\'ai changé la RAM d\'un utilisateur. Suite à ça, j\'ai testé les logiciels si tout fonctionnait et cela marchait bien. Après avoir fini cette intervention, j\'ai dû changé la RAM dans une salle à côté avec la RAM que je venait de prendre (J\'ai pris ceux de l\'autre PC car Jorge a commandé 4 barrettes de RAM pour ce PC et son idée était de retirer les deux de base et les mettre dans le pc de la pièce à côté). Mais il s\'avère qu\'elles n\'étaient pas compatibles (DDR4 à la place de DDR3). Du coup j\'ai dû fouiller un peu dans nos stocks pour finalement trouver ce que je recherchais. Je les ai installé et tout fonctionnait parfaitement.',7),(14241,383,'2017-11-15 12:00:00',5,'J\'ai passé la journée à faire des tests sur Sharepoint avec les webapps.',10),(14242,383,'2017-11-14 12:00:00',1,'J\'ai quitté le boulot un peu plus tôt (RDV médecin). ',11),(14243,383,'2017-11-17 12:00:00',1,'Je prends une petite heure pour les tâches administratives et le journal.',7),(14244,383,'2017-11-17 12:00:00',2,'J\'ai continué de faire la documentation du Sharepoint. Jorge m\'a fait un retour sur la doc et il m\'a dit que c\'était du bon boulot. Il m\'a proposé de mettre ces différentes applications dans le teamsite qu\'on utilise actuellement.',3),(14245,383,'2017-11-16 12:00:00',2,'J\'ai migré l\'ordinateur d\'un utilisateur. Un petit problème est apparu au moment de l\'installation. Le logiciel fonctionne mais affiche une erreur au lancement. J\'ai cherché mais je n\'ai rien trouvé. Je vais attendre le retour de Nicolas pour trouver une solution. En attendant, l\'ordinateur fonctionne du coup je l\'ai laissé à l\'utilisateur.',9),(14246,383,'2017-11-16 12:00:00',5,'Mes collègues m\'ont demandés un peu d\'aide pour les tickets du coup j\'ai un peu participé dans l\'équipe support. J\'avais rien de grandiose, juste un ordinateur sur place, vérifier le disque dur (car le disque dur de l\'utilisateur était plein)....',2),(14247,405,'2017-11-13 00:00:00',0,'A remplir',7),(14248,405,'2017-11-14 00:00:00',0,'A remplir',7),(14249,405,'2017-11-15 00:00:00',0,'A remplir',7),(14250,405,'2017-11-16 00:00:00',0,'A remplir',7),(14251,405,'2017-11-17 00:00:00',0,'A remplir',7);
