équipe « Integration & Development » est composée de 5 ingénieurs et d’un Team Leader.  Elle est sollicitée pour tout type de développement en interne que ce soit pour l’IT ou d’autres départements. Les technologies utilisées sont entre autres JAVA – JEE, BPEL, PHP5, Python, etc…\r\nLe stagiaire est sollicité par l’équipe pour divers travaux en fonction des connaissances et de la motivation démontrée. Les premiers travaux sont de petites envergures afin de laisser un temps pour s’adapter et faire ses preuves. Les premières tâches seront généralement :\r\n·         Effectuer des modifications sur des applications web (PHP & Java)\r\n·         Rédiger de la documentation\r\n·         Se former sur les framework technologies utilisées\r\nChaque semaine du temps est laissé au stagiaire pour se former personnellement et de manière autodidacte. Suite à quoi, l’équipe pourra lui proposer des projets de moyennes ou grandes envergures. Le projet peut être, par exemple, une application web qui comprend les phases (Analyse, Conception, Réalisation, Tests, Mise en service).\r\nL’équipe est souvent très prise. C’est pourquoi le triangle des compétences requis pour ce stage est : l’autonomie, la débrouillardise et la motivation.'),(1986,5,134,'2014-01-27 13:23:46','XCL','Descriptif du stage modifié: L’équipe « Integration & Development » est composée de 5 ingénieurs et d’un Team Leader. Elle est sollicitée pour tout type de développement en interne que ce soit pour l’IT ou d’autres départements. Les technologies utilisées sont entre autres JAVA – JEE, BPEL, PHP5, Python, etc…\r\nLe stagiaire est sollicité par l’équipe pour divers travaux en fonction des connaissances et de la motivation démontrée. Les premiers travaux sont de petites envergures afin de laisser un temps pour s’adapter et faire ses preuves. Les premières tâches seront généralement :\r\n· Effectuer des modifications sur des applications web (PHP & Java)\r\n· Rédiger de la documentation\r\n· Se former sur les framework technologies utilisées\r\nChaque semaine du temps est laissé au stagiaire pour se former personnellement et de manière autodidacte. Suite à quoi, l’équipe pourra lui proposer des projets de moyennes ou grandes envergures. Le projet peut être, par exemple, une application web qui comprend les phases (Analyse, Conception, Réalisation, Tests, Mise en service).\r\nL’équipe est souvent très prise. C’est pourquoi le triangle des compétences requis pour ce stage est : l’autonomie, la débrouillardise et la motivation.'),(1987,4,167,'2014-01-27 13:27:00','XCL','Note: 5'),(1988,4,167,'2014-01-27 13:27:00','XCL','Rapport enregistré'),(1989,4,163,'2014-01-28 10:26:36','XCL','Note: 4.5'),(1990,4,163,'2014-01-28 10:26:36','XCL','Rapport enregistré'),(1991,4,166,'2014-01-28 10:27:12','XCL','Note: 5.5'),(1992,4,166,'2014-01-28 10:27:12','XCL','Rapport enregistré'),(1993,4,169,'2014-01-28 10:28:29','XCL','Impossible de trouver une date pour se rencontrer. Etant donnée que tout se passe très bien, il a été décidé de faire l\'évaluation par simple échange d\'email.'),(1994,4,169,'2014-01-28 10:28:55','XCL','Note: 6'),(1995,4,169,'2014-01-28 10:28:55','XCL','Rapport enregistré'),(1996,4,173,'2014-01-28 13:54:16','XCL','Note: 5.5'),(1997,4,173,'2014-01-28 13:54:16','XCL','Rapport enregistré'),(1998,5,104,'2014-01-31 12:45:27','JTT','Nouvel état: Signé. Raison: Contrat Reçu'),(1999,5,37,'2014-02-02 19:29:40','XCL','Reçu rapport de stage'),(2000,5,48,'2014-02-02 19:33:54','XCL','Reçu rapport de stage'),(2001,5,92,'2014-02-02 19:41:28','XCL','Pas reçu de rapport final. J\'avais reçu un rapport le 13.1, mais il n\'avait rien de final'),(2002,5,50,'2014-02-02 19:42:30','XCL','Rapport de stage pas reçu'),(2003,5,91,'2014-02-02 19:44:03','XCL','Reçu rapport de stage'),(2004,5,61,'2014-02-02 19:45:38','XCL','Reçu rapport de stage'),(2005,5,60,'2014-02-02 19:46:54','XCL','Reçu rapport de stage'),(2006,5,54,'2014-02-02 19:48:00','XCL','Reçu rapport de stage'),(2007,5,78,'2014-02-02 19:48:46','