portunité d\'engagement de stagiaires et comprendre comment cela fonctionne. En effet ITS SA, suite à une demande récente chez un important client (Nestlé), nous allons avoir d\'importants projets  où des stagiaires pourraient profiter de cette expérience.\"'),(3804,2,187,'2014-07-15 13:53:03','RMN','RH chez Swissquote'),(3805,2,126,'2014-07-16 11:46:46','XCL','Souhait (rang 2) pour le stage ETML'),(3806,5,186,'2014-07-16 11:46:46','XCL','Souhait (rang 2) de Nathan FLUCKIGER'),(3807,1,71,'2014-07-17 08:50:56','XCL','Téléphone avec M. Prêtre responsable des stages pour voir s\'ils auraient une place pour LMO. Toutes leurs places sont malheureusement pourvues.'),(3808,1,83,'2014-07-21 12:59:41','RMN','Appel téléphonique le 15.07. Pas de réponse.\r\nMail le 15.07. Réponse automatique, retour de vacances de M. Mooser le 05.08'),(3809,1,82,'2014-07-21 13:03:09','RMN','Appel le 15.07. Personne . Appel le 21.07. Pas de réponse. Mail. Réponse automatique en vacances jusqu\'au 06.08'),(3810,1,78,'2014-07-21 13:06:16','RMN','Appel le 15.07. Pas de réponse. Appel le 21.07. Pas de réponse. Mail le 21.07.'),(3811,5,191,'2014-07-21 13:11:30','RMN','Place libérée'),(3812,5,191,'2014-07-21 13:11:53','RMN','Refus de MBN le 21.07'),(3813,5,191,'2014-07-21 13:12:26','RMN','Impossible de joindre rosset ou hamon. J\'envoie un mail pour peut être placer LMO '),(3814,5,191,'2014-07-21 13:17:43','RMN','Réponse automatique : Hamon en vacances jusqu\'au 10.08'),(3815,5,191,'2014-07-21 13:18:07','RMN','Réponse automatique : Rosset en vacances jusqu\'au 10.08'),(3816,1,36,'2014-07-21 13:51:24','RMN','Mail envoyé le 21.07 pour aller à la pêche à la place de stage'),(3817,1,52,'2014-07-22 08:16:30','XCL','Téléphone avec M. Simond.\r\nA priori il n\'y a pas de place dispo parce que maintenant il peuvent engager des civilistes vu qu\'ils sont une fondation.\r\nJe lui envoie (à sa demande) la documentation quand même à tout hasard, mais les chances sont très minces.'),(3818,1,85,'2014-07-22 09:41:15','XCL','Ajoutée à la liste d\'entreprises'),(3819,1,85,'2014-07-22 09:48:51','XCL','Téléphone avec M. Minck. Ils sont effectivement intéressé à prendre un stagiaire, mais uniquement un tech web. Je lui ai dit que nos techniciens ont actuellement tous une place mais qu\'on communiquera leur nom à la prochaine volée pour qu\'ils prennent contact.'),(3820,5,191,'2014-07-28 09:26:49','RMN','Discussion téléphonique avec julien Rosset : MBN pas retenu par manque de motivation et de dynamisme. EHL OK pour un autre candidat. On propose la place à LMO.'),(3821,5,191,'2014-07-28 09:27:28','RMN','Place attribuée à Lionel MICCO'),(3822,5,178,'2014-07-28 09:29:30','RMN','Nouvel état: Signature (apprenti). Raison: Mail de TSA du 25.07.14'),(3823,1,52,'2014-07-29 11:59:25','XCL','Email de M. Simond : \"la collaboration avec vos apprentis n’a laissé que de bons souvenirs.\r\nNous serions donc heureux de pouvoir à nouveau accueillir des stagiaires dans nos locaux mais, notre département étant en pleine restructuration, nous n’aurions pas les ressources nécessaires pour les accompagner correctement à ce jour.\"<br>Reprendre contact pour les stages 2 2014-2015 (au printemps 2015)'),(3824,1,83,'2014-08-08 09:25:21','XCL','Réponse de M. Mooser (email): un peu court pour le 1er septembre, mais intéressé pour plus tard'),(3825,1,83,'2014-08-08 09:26:17','XCL','Ajouté place de stage (1.2.2015 - 31.8.2015). Raison: Intérêt exprimé par M. Mooser'),(3826,5,194,'2014-08-08 09:26:56','XCL','Responsable administratif du stage: Chris MOOSER. Raison: email de M. Mooser'),(3827,5,194,'2014-08-08 09:26:56','XCL','Nouvel état: Accord de principe. Raison: email de M. Mooser'),(3828,5,185,'2014-08-08 09:34:11','RMN','Nouvel état: Signature (apprenti). Raison: Téléphone du 07.08.2014'),(3829,5,172,'2014-08-08 09:34:50','RMN','Nouvel état: Signature (apprenti). Raison: Mail du 05.08.2014'),(3830,1,78,'2014-08-08 09:47:07','RMN','Ajouté place de stage (01.02.2015 - 31.08.2015). Raison: Mails avec Mme Cu