ication web qui comprend les phases (Analyse, Conception, Réalisation, Tests, Mise en service).\r\nL’équipe est souvent très prise. C’est pourquoi le triangle des compétences requis pour ce stage est : l’autonomie, la débrouillardise et la motivation.'),(4128,5,114,'2014-10-31 10:12:31','RMN','Nouvel état: Effectué'),(4129,5,103,'2014-10-31 10:12:42','RMN','Nouvel état: Effectué'),(4130,5,137,'2014-10-31 10:12:53','RMN','Nouvel état: Effectué'),(4131,5,105,'2014-10-31 10:13:03','RMN','Nouvel état: Effectué'),(4132,5,102,'2014-10-31 10:13:12','RMN','Nouvel état: Effectué'),(4133,5,113,'2014-10-31 10:13:24','RMN','Nouvel état: Effectué'),(4134,5,98,'2014-10-31 10:13:35','RMN','Nouvel état: Effectué'),(4135,5,100,'2014-10-31 10:13:43','RMN','Nouvel état: Effectué'),(4136,5,108,'2014-10-31 10:13:51','RMN','Nouvel état: Effectué'),(4137,5,93,'2014-10-31 10:14:01','RMN','Nouvel état: Effectué'),(4138,4,309,'2014-10-31 10:18:57','RMN','Date fixée: 31.08.2014'),(4139,4,309,'2014-10-31 10:18:57','RMN','Status: OK'),(4140,4,309,'2014-10-31 10:18:57','RMN','Note: 6'),(4141,4,309,'2014-10-31 10:18:57','RMN','Rapport enregistré'),(4142,4,310,'2014-10-31 10:19:51','RMN','Date fixée: 31.08.2014'),(4143,4,310,'2014-10-31 10:19:51','RMN','Status: OK'),(4144,4,310,'2014-10-31 10:19:51','RMN','Note: 5.5'),(4145,4,310,'2014-10-31 10:19:51','RMN','Rapport enregistré'),(4146,4,311,'2014-10-31 10:20:45','RMN','Date fixée: 31.08.2014'),(4147,4,311,'2014-10-31 10:20:45','RMN','Status: OK'),(4148,4,311,'2014-10-31 10:20:45','RMN','Note: 6'),(4149,4,311,'2014-10-31 10:20:45','RMN','Rapport enregistré'),(4150,5,168,'2014-11-03 08:05:22','RMN','Responsable de stage: Luca VIRGILIO'),(4151,5,167,'2014-11-03 08:05:38','RMN','Responsable de stage: Luca VIRGILIO'),(4152,4,308,'2014-11-04 07:47:54','JTT','Note: 6.0'),(4153,4,308,'2014-11-04 07:47:54','JTT','Rapport enregistré'),(4154,1,87,'2014-11-04 13:06:04','XCL','Ajoutée à la liste d\'entreprises'),(4155,1,87,'2014-11-04 13:16:45','XCL','Ajouté p