g.\r\nMission 2\r\nEvaluate and implement a monitoring solution in a complex environment. Typical Profile: Developer Profile / Network Profile.\r\nMission 3\r\nThe Project shall consist in designing a multi-automated scanner manager. In particular, finalize the network scanning part, implement the web application scanning part, the recommendation part and link that to a GUI.\r\nMission 4\r\nThe Project shall consist in designing dynamical dashboard viewer to be linked with a TV, running on a RaspBerry Pi.\r\nMission 5\r\nDevelop a frontend web application that helps manage / handle a massive portscanning framework performing multiple worldwide scans per day.\r\nMission 6\r\nDevelop a tool in C/C++ on Windows or Linux, preferably based on QEMU, to allow the emulation of a specific type of ARM controller with S-ATA interface. Typical profile: C/C+ / embedded devices.\r\nDevelop a web application based on the Yii 2 framework (mandatory) according to an already existing specification.'),(6571,5,287,'2015-10-07 08:57:03','XCL','Nouvel état: Confirmé. Raison: email de M. Troillet'),(6572,5,295,'2015-10-07 12:48:37','XCL','Nouvel état: Confirmé. Raison: email de Mme Mettral'),(6573,5,266,'2015-10-07 16:20:04','XCL','Nouvel état: Confirmé. Raison: email de Mme Gonzalez'),(6574,5,296,'2015-10-07 16:21:14','XCL','Nouvel état: Rejeté. Raison: Pas de candidat possible'),(6575,5,297,'2015-10-08 07:10:41','XCL','Nouvel état: Annulé. Raison: Jordan renonce au stage à l\'étranger: trop d\'incertitudes à son goût'),(6576,5,297,'2015-10-08 07:11:37','XCL','Place libérée'),(6577,5,265,'2015-10-08 07:15:25','XCL','Nouvel état: Confirmé. Raison: On anticipe un peu pour permettre aux élèves de faire leurs choix. Peu de risques de se tromper suite à l\'entrevue que j\'ai eue avec Fabrice Roublot il y a trois semaines.'),(6578,5,274,'2015-10-08 07:16:08','XCL','Nouvel état: Confirmé'),(6579,5,274,'2015-10-08 07:16:23','XCL','Place attribuée à Alexandre PELLATON'),(6580,1,93,'2015-10-08 07: