tat: Confirmé. Raison: email de M. Hauswirth'),(6598,5,265,'2015-10-13 12:59:55','XCL','Descriptif du stage modifié: Participation au développement d\'applications mobiles Android, IOs et Windows universelle.\r\nCes applications reprennent les fonctionnalités www.intrepidknowledge.ch :\r\ncours, communications par posts, dossiers et fichiers partagés, etc.\r\n\r\nLes langages sont donc potentiellement java, C#, javascript, Objective C en\r\nplus des framework mobile de Microsoft, Apple et Android.'),(6599,5,275,'2015-10-14 21:00:44','XCL','Nouvel état: Confirmé. Raison: email de M. Noverraz'),(6600,1,42,'2015-10-26 12:09:03','XCL','Suppression du stage Feb 2016-Aug 2016. Raison: Email de S. Beljakovic: \"Nous avons actuellement une personne détachée de la production qui assume les tâches attribuées au stagiaire. Nous avons de ce fait pas de besoin pour février 2016\"'),(6601,1,42,'2015-10-26 12:10:13','XCL','Suppression du stage Sep 2015-Jan 2016. Raison: Pas de candidat à proposer'),(6602,2,218,'2015-10-27 12:53:19','RSG','Souhait (rang 1) pour le stage HEIG-VD'),(6603,5,269,'2015-10-27 12:53:19','RSG','Souhait (rang 1) de Raphael SCHNEGG'),(6604,5,269,'2015-10-27 12:56:22','RSG','Souhait de Raphael SCHNEGG retiré'),(6605,2,218,'2015-10-27 12:56:22','RSG','Suppression du souhait pour le stage HEIG-VD'),(6606,2,218,'2015-10-27 12:56:25','RSG','Souhait (rang 1) pour le stage HEIG-VD'),(6607,5,270,'2015-10-27 12:56:25','RSG','Souhait (rang 1) de Raphael SCHNEGG'),(6608,2,218,'2015-10-27 12:56:58','RSG','Souhait (rang 2) pour le stage Nestlé Product Technology Center'),(6609,5,280,'2015-10-27 12:56:58','RSG','Souhait (rang 2) de Raphael SCHNEGG'),(6610,2,218,'2015-10-27 13:00:49','RSG','Souhait (rang 3) pour le stage Kudelski'),(6611,5,271,'2015-10-27 13:00:49','RSG','Souhait (rang 3) de Raphael SCHNEGG'),(6612,2,241,'2015-10-27 13:25:21','JAH','Souhait (rang 1) pour le stage Medtronic'),(6613,5,298,'2015-10-27 13:25:21','JAH','Souhait (rang 1) de Jordan  ASSAYAH'),(66