phone 2 (sous Android, peut-être bientôt Ubuntu Touch)\r\n - autres projets en lien avec les perspectives offertes par l\'open hardware.'),(8326,5,265,'2016-04-20 11:10:04','CER','Nouvel état: Signature Doyen'),(8327,5,265,'2016-04-20 11:10:14','CER','Nouvel état: Signé'),(8328,5,268,'2016-04-21 07:32:20','XCL','Responsable administratif du stage: Dominique Rovero. Raison: Selon mail du stagiaire'),(8329,4,553,'2016-04-27 11:42:49','CRY','Date fixée: 10.05.2016 08:30'),(8330,4,554,'2016-04-27 11:43:40','CRY','Date fixée: 10.05.2016 09:00'),(8331,4,555,'2016-04-27 11:44:23','CRY','Date fixée: 10.05.2016 10:00'),(8332,4,556,'2016-04-27 11:45:51','CRY','Date fixée: 10.05.2016 11:00'),(8333,4,558,'2016-04-27 11:46:52','CRY','Date fixée: 10.5.16 13:30'),(8334,4,559,'2016-04-27 11:48:23','CRY','Date fixée: 17.05.2016 08:00'),(8335,4,560,'2016-04-27 11:49:07','CRY','Date fixée: 17.05.2016 09:30'),(8336,4,561,'2016-04-27 11:50:16','CRY','Date fixée: 17.5.16 11:00'),(8337,4,562,'2016-04-27 11:50:53','CRY','Date fixée: 17.5.16 11:30'),(8338,4,563,'2016-04-27 11:51:40','CRY','Date fixée: 17.5.16 14:00'),(8339,4,564,'2016-04-27 11:52:35','CRY','Date fixée: 17.5.16 15:00'),(8340,4,565,'2016-04-27 11:53:40','CRY','Date fixée: 24.5.16 8:30'),(8341,4,566,'2016-04-27 11:54:45','CRY','Date fixée: 24.5.16 11:30'),(8342,4,567,'2016-04-27 11:55:41','CRY','Date fixée: 31.5.16 9:30'),(8343,4,568,'2016-04-27 11:56:34','CRY','Date fixée: 31.5.16 13:30'),(8344,4,553,'2016-04-27 13:35:01','CRY','Status: OK'),(8345,4,564,'2016-04-27 13:35:32','CRY','Status: OK'),(8346,4,567,'2016-04-27 13:35:55','CRY','Status: OK'),(8347,4,560,'2016-04-27 13:36:50','CRY','Date fixée: 17.05.2016 10:30'),(8348,4,560,'2016-04-27 13:36:50','CRY','Status: OK'),(8349,4,559,'2016-04-27 13:37:53','CRY','Date fixée: 17.5.2016 09:00'),(8350,4,559,'2016-04-27 13:37:53','CRY','Status: OK'),(8351,4,568,'2016-04-27 13:38:19','CRY','Status: OK'),(8352,4,554,'2016-04-27 13:38:41','CRY','Status: OK'),(8353,4,561,'2016-04-27 15