 équipe lors de votre stage.\r\nVos principales tâches seront les suivantes :\r\n - Développement de thèmes responsive Wordpress\r\n - Développement de fonctionnalités Wordpress\r\n\r\nVous aurez l’occasion de travailler avec les technologies suivantes :\r\n - HTML 5\r\n - CSS / SCSS \r\n - Javascript / Jquery\r\n - Wordpress\r\n\r\nNous offrons un cadre de travail dynamique au sein de l’EPFL Innovation Park à Lausanne (5 minutes en métro de la gare de Renens) avec café offert.\r\n\r\nNotre équipe sera là pour vous former sur Wordpress et répondre à vos questions durant le stage.\r\n'),(8899,5,332,'2016-06-07 17:35:55','SGD','Souhait de Sarah  GUIGNARD retiré'),(8900,2,245,'2016-06-07 17:35:55','SGD','Suppression du souhait pour le stage Nespresso (Avenches)'),(8901,5,310,'2016-06-07 17:35:57','SGD','Souhait de Sarah  GUIGNARD retiré'),(8902,2,245,'2016-06-07 17:35:57','SGD','Suppression du souhait pour le stage Nestlé Research Center'),(8903,2,245,'2016-06-07 17:36:06','SGD','Souhait (rang 2) pour le stage Kudelski Security'),(8904,5,317,'2016-06-07 17:36:06','SGD','Souhait (rang 2) de Sarah  GUIGNARD'),(8905,5,317,'2016-06-07 17:36:10','SGD','Souhait de Sarah  GUIGNARD retiré'),(8906,2,245,'2016-06-07 17:36:10','SGD','Suppression du souhait pour le stage Kudelski Security'),(8907,2,245,'2016-06-07 17:36:12','SGD','Souhait (rang 2) pour le stage Kudelski Security'),(8908,5,316,'2016-06-07 17:36:12','SGD','Souhait (rang 2) de Sarah  GUIGNARD'),(8909,2,245,'2016-06-07 17:36:31','SGD','Souhait (rang 3) pour le stage WhyOpenComputing'),(8910,5,307,'2016-06-07 17:36:31','SGD','Souhait (rang 3) de Sarah  GUIGNARD'),(8911,5,308,'2016-06-07 18:06:31','VIN','Souhait de Virgil IN-ALBON retiré'),(8912,2,266,'2016-06-07 18:06:31','VIN','Suppression du souhait pour le stage Liip'),(8913,5,333,'2016-06-08 05:39:26','JAT','Souhait de Julien  AUDIBERT retiré'),(8914,2,242,'2016-06-08 05:39:26','JAT','Suppression du souhait pour le stage Nestlé Product Technology Center'),(8915,5,3