 stage Liip'),(8962,5,308,'2016-06-08 10:18:16','VIN','Souhait (rang 3) de Virgil IN-ALBON'),(8963,5,308,'2016-06-08 10:18:20','VIN','Souhait de Virgil IN-ALBON retiré'),(8964,2,266,'2016-06-08 10:18:20','VIN','Suppression du souhait pour le stage Liip'),(8965,2,266,'2016-06-08 10:18:26','VIN','Souhait (rang 3) pour le stage Liip'),(8966,5,308,'2016-06-08 10:18:26','VIN','Souhait (rang 3) de Virgil IN-ALBON'),(8967,2,254,'2016-06-08 11:02:18','KBO','Souhait (rang 3) pour le stage Medtronic'),(8968,5,331,'2016-06-08 11:02:18','KBO','Souhait (rang 3) de Krisyam-Yves BAMOGO'),(8969,5,336,'2016-06-08 11:12:21','XCL','Descriptif du stage modifié: Nous recherchons une personne polyvalente autant intéressée par le développement que le système.\r\nNotre infrastructure couvre un large panel de technologie.\r\n\r\nLe travail de fond consiste à :\r\n- assurer le support 1er niveau (bureautique, aide & formation au utilisateur) \r\n- assurer des travaux de gestion de parc (installation, maintenance, dépannage). \r\n- des tâches d\'administration plus pointue en fonction de ces capacité (gestion serveur, utilisation de SCCM)\r\n-> cela représente environ 50% de l\'activité à noter que la charge peut varier de 0 à 100% selon les jours\r\n\r\nLe reste du temps, le stagiaire se verra attribuer des tâches de développements\r\nDans le cadre de la mise en place d\'un ERP, notre objectif est de fournir des interfaces simple pour les traveaux répétitif : saisie de temps de production, manipulation de stock, etc...\r\nLe stagiaire créera des interfaces web/mobile avec des technologie tel que node.js, meteor, react/angular/cordova. \r\nCeci sous forme de module sur la première partie du stage afin de monter en compétence. \r\nSur la deuxième partie, il créera une application \"full-stack\"'),(8970,5,311,'2016-06-08 11:22:33','BGS','Souhait de Bruno  GONCALVES retiré'),(8971,2,244,'2016-06-08 11:22:33','BGS','Suppression du souhait pour le stage Nestlé Product Technology Center'),(8972,5,3