 stage Feb 2017-Aug 2017. Raison: emailde M. Hauswirth: On passe un tour, et on proposera probablement une place en automne 2017'),(9809,5,372,'2016-10-31 16:59:49','XCL','Nouvel état: Confirmé. Raison: email de M. Pasqualini'),(9810,5,372,'2016-10-31 17:00:11','XCL','Montant du salaire brut modifié: 1500'),(9811,4,610,'2016-10-31 23:20:02','CRY','Status: OK'),(9812,4,613,'2016-10-31 23:20:27','CRY','Status: OK'),(9813,5,356,'2016-11-02 09:12:06','XCL','Descriptif du stage modifié: Réalisation ou participation à l\'un ou l\'autre des projets suivants:\r\nMission 1\r\nImprove Visualization of Big Data based on access flows to buildings. Typical profile: 2D/3D design on Web Objects. Database querying.\r\nMission 2\r\nEvaluate and implement a monitoring solution in a complex environment. Typical Profile: Developer Profile / Network Profile.\r\nMission 3\r\nThe Project shall consist in designing a multi-automated scanner manager. In particular, finalize the network scanning part, implement the web application scanning part, the recommendation part and link that to a GUI.\r\nMission 4\r\nThe Project shall consist in designing dynamical dashboard viewer to be linked with a TV, running on a RaspBerry Pi.\r\nMission 5\r\nDevelop a frontend web application that helps manage / handle a massive portscanning framework performing multiple worldwide scans per day.\r\nMission 6\r\nDevelop a tool in C/C++ on Windows or Linux, preferably based on QEMU, to allow the emulation of a specific type of ARM controller with S-ATA interface. Typical profile: C/C+ / embedded devices.\r\nDevelop a web application based on the Yii 2 framework (mandatory) according to an already existing specification.'),(9814,5,356,'2016-11-02 09:12:24','XCL','Nouvel état: Confirmé. Raison: Discussion avec J. Conus'),(9815,5,365,'2016-11-02 09:12:53','XCL','Nouvel état: Confirmé. Raison: suite à la visite de Jérôme'),(9816,2,317,'2016-11-02 10:12:03','SGZ','Souhait (rang 1) pour le stage Ecole Cantonale d&apos;