l systems connectivity\r\n•	Implement the ordering workflows based on internal guidelines & best practices\r\n•	Implement web services & data connection with external systems and user management\r\n•	Implement intelligent web forms\r\n•	Work in collaboration with R&D departments, IT support teams and technical experts\r\n•	Take part in the related project as a key project member\r\n\r\nKey responsibilities\r\n\r\n•	Workflow implementation & specification of the test strategy\r\n•	Define reusable sub process part\r\n•	Documentation and training material generation\r\n•	Reports on a weekly basis to the project manager and take part in the Project core team meetings (stand-up meetings, planning meetings, demo)\r\n•	Reports to the Process Management team & Industrialization Team leader\r\n\r\nEducation and experience\r\n\r\n•	Software development knowledge\r\n•	Microsoft tools and web services development would be a plus\r\n•	Great interest to learn and work on new technologies\r\n•	Fluent in French and English is a plus'),(10883,5,358,'2016-11-22 08:12:25','XCL','Souhait de Senistan JEGARAJASINGAM retiré'),(10884,2,302,'2016-11-22 08:12:25','XCL','Suppression du souhait pour le stage Ecole Cantonale d&apos;Art de Lausanne'),(10885,5,349,'2016-11-22 08:12:30','XCL','Souhait de Senistan JEGARAJASINGAM retiré'),(10886,2,302,'2016-11-22 08:12:30','XCL','Suppression du souhait pour le stage WhyOpenComputing'),(10887,2,302,'2016-11-22 08:12:37','XCL','Souhait (rang 1) pour le stage NagraVision (Kudelski)'),(10888,5,355,'2016-11-22 08:12:37','XCL','Souhait (rang 1) de Senistan JEGARAJASINGAM'),(10889,5,355,'2016-11-22 08:12:47','XCL','Candidature: Senistan JEGARAJASINGAM'),(10890,2,302,'2016-11-22 08:12:47','XCL','Candidature au stage NagraVision (Kudelski) acceptée'),(10891,2,302,'2016-11-22 08:13:09','XCL','Souhait (rang 2) pour le stage WhyOpenComputing'),(10892,5,349,'2016-11-22 08:13:09','XCL','Souhait (rang 2) de Senistan JEGARAJASINGAM'),(10893,2,302,'2016-11-22 08:13: