 (1er et 2ème niveau)\r\n- Déploiement et installation d’équipements divers (Desktop, Laptop, Smartphone, Tablet…)\r\n- Suivi des demandes et pannes via notre outil de gestion des tickets\r\n- Réalisation de divers projets pour notre équipe\r\nNotre site hébergeant une des usines de production de technologies médicales vous aurez également la chance de pouvoir travailler en lien avec la production.\r\nTout au long de votre stage vos développerez les points suivants \r\n- Méthodologie de travail dans un environnement complexe\r\n- Logique de dépannage matériel et logiciel\r\n- Anglais oral et écrit. Un atout indispensable pour votre futur dans le monde de l’informatique.\r\nVos avantages seront les suivants : \r\n- Vous effectuerez les mêmes tâches que les membres de l’équipe IT\r\n- Repas de midi offert à la cafétéria de l’entreprise dont 4 menus à choix proposés par nos\r\n  chefs cuisiniers\r\n- Matériel de support fourni que vous pouvez conserver à la fin de votre stage tel que : disque dur \r\n  externe, Cyber Tools, baie d’extraction pour disque dur, trousse à outil de dépannage…\r\n- Possibilité de voir votre salaire augmenté au mérite sous forme de « Cash Award » '),(11552,5,366,'2017-04-30 13:48:38','XCL','Descriptif du stage modifié: En tant que leader mondial dans le domaine des technologies médicales, Medtronic vous propose un stage dans une équipe informatique dynamique et passionnée. \r\nVotre mission sera de travailler et d’acquérir des compétences « IT » afin de gagner en autonomie dans un support informatique. \r\n\r\nVous effectuerez des tâches variées telle que :\r\n- Dépannage matériel et logiciel (1er et 2ème niveau)\r\n- Déploiement et installation d’équipements divers (Desktop, Laptop, Smartphone, Tablet…)\r\n- Suivi des demandes et pannes via notre outil de gestion des tickets\r\n- Réalisation de divers projets pour notre équipe\r\nNotre site hébergeant une des usines de production de technologies médicales vous aurez également la chance de pouvoir travailler en lien avec la production.\r\nTout au long de votre stage vos développerez les points suivants \r\n- Méthodologie de travail dans un environnement complexe\r\n- Logique de dépannage matériel et logiciel\r\n- Anglais oral et écrit. Un atout indispensable pour votre futur dans le monde de l’informatique.\r\nVos avantages seront les suivants : \r\n- Vous effectuerez les mêmes tâches que les membres de l’équipe IT\r\n- Repas de midi offert à la cafétéria de l’entreprise dont 4 menus à choix proposés par nos chefs cuisiniers\r\n- Matériel de support fourni que vous pouvez conserver à la fin de votre stage tel que : disque dur externe, Cyber Tools, baie d’extraction pour disque dur, trousse à outil de dépannage…\r\n- Possibilité de voir votre salaire augmenté au mérite sous forme de « Cash Award » '),(11553,1,80,'2017-05-06 12:30:47','XCL','Contact email+téléphone avec M. Rosset de l\'école hôtelière. Il va rejoindre l\'eesp cet été et souhaite y prendre un stagiaire en septembre. Je lui ai envoyé la doc habituelle.'),(11554,1,80,'2017-05-12 11:59:26','XCL','Ajouté place de stage (1.9.2017 - 31.1.2018). Raison: Confirmation de M. Rosset'),(11555,5,389,'2017-05-12 12:00:26','XCL','Nouvel état: Confirmé. Raison: email de M. Rosset'),(11556,5,389,'2017-05-12 12:00:26','XCL','Descriptif du stage modifié: Activités principales, en collaboration avec le responsable de chaque service :\r\n•	CMS\r\no	Participer à l\'évolution du CMS, des bases de données et des serveurs web\r\n•	Réseaux\r\no	Comprendre, connaître et faire évoluer l\'infrastructure des réseaux de manière à assurer qualité de service et sécurité.\r\n•	Serveurs\r\no	Comprendre, connaître et faire évoluer l\'infrastructure serveurs de manière à assurer fiabilité, efficience pour les services.\r\n•	Postes clients\r\no	Maintenir et réaliser les mises à jour des postes de travail\r\no	Maintenir et faire évoluer les images systèmes\r\no	Support 2ème niveau (OS, applications)\r\no	Suivi de l’inventaire\r\n•	Support aux utilisateurs-trices\r\no	Assurer le service du Help Desk\r\no	Assurer des tâches techniques du service informatique\r\no	Gestion du matériel en prêt (vidéo, ordinateurs)\r\no	Maintenance et création de mode d’emploi\r\n•	Réalisation de projets individuels dans les domaines cités ci-dessous (exemples)\r\no	Mise en place d\'un serveur de streaming vidéo\r\no	Virtualisation (environnement RHEV)\r\no	Evaluation et comparaison de logiciels\r\no	Gouvernance, construction d’indicateurs \r\nActivités annexes :\r\n•	Maintenir et améliorer ses compétences par une formation continue\r\n•	Maintenir et mettre à jour la documentation du SIM\r\n•	Veille technologique\r\nRelations internes / externes au service :\r\n•	Participer aux réunions hebdomadaires du SIM et à d’autres séances de travail internes.\r\n'),(11557,5,389,'2017-05-12 12:01:19','XCL','Descriptif du stage modifié: Activités principales, en collaboration avec le responsable de chaque service :\r\n•	CMS\r\n    o	Participer à l\'évolution du CMS, des bases de données et des serveurs web\r\n•	Réseaux\r\n    o	Comprendre, connaître et faire évoluer l\'infrastructure des réseaux de manière à assurer qualité de service et sécurité.\r\n•	Serveurs\r\n    o	Comprendre, connaître et faire évoluer l\'infrastructure serveurs de manière à assurer fiabilité, efficience pour les services.\r\n•	Postes clients\r\n    o	Maintenir et réaliser les mises à jour des postes de travail\r\n    o	Maintenir et faire évoluer les images systèmes\r\n    o	Support 2ème niveau (OS, applications)\r\n    o	Suivi de l’inventaire\r\n•	Support aux utilisateurs-trices\r\n    o	Assurer le service du Help Desk\r\n    o	Assurer des tâches techniques du service informatique\r\n    o	Gestion du matériel en prêt (vidéo, ordinateurs)\r\n    o	Maintenance et création de mode d’emploi\r\n•	Réalisation de projets individuels dans les domaines cités ci-dessous (exemples)\r\n    o	Mise en place d\'un serveur de streaming vidéo\r\n    o	Virtualisation (environnement RHEV)\r\n    o	Evaluation et comparaison de logiciels\r\n    o	Gouvernance, construction d’indicateurs \r\nActivités annexes :\r\n•	Maintenir et améliorer ses compétences par une formation continue\r\n•	Maintenir et mettre à jour la documentation du SIM\r\n•	Veille technologique\r\nRelations internes / externes au service :\r\n•	Participer aux réunions hebdomadaires du SIM et à d’autres séances de travail internes.\r\n'),(11558,5,389,'2017-05-12 12:02:39','XCL','Descriptif du stage modifié: Activités principales, en collaboration avec le responsable de chaque service :\r\n--- CMS --- \r\n    o	Participer à l\'évolution du CMS, des bases de données et des serveurs web\r\n--- Réseaux --- \r\n    o	Comprendre, connaître et faire évoluer l\'infrastructure des réseaux de manière à assurer qualité de service et sécurité.\r\n--- Serveurs --- \r\n    o	Comprendre, connaître et faire évoluer l\'infrastructure serveurs de manière à assurer fiabilité, efficience pour les services.\r\n--- Postes clients --- \r\n    o	Maintenir et réaliser les mises à jour des postes de travail\r\n    o	Maintenir et faire évoluer les images systèmes\r\n    o	Support 2ème niveau (OS, applications)\r\n    o	Suivi de l’inventaire\r\n--- Support aux utilisateurs-trices --- \r\n    o	Assurer le service du Help Desk\r\n    o	Assurer des tâches techniques du service informatique\r\n    o	Gestion du matériel en prêt (vidéo, ordinateurs)\r\n    o	Maintenance et création de mode d’emploi\r\n--- Réalisation de projets individuels dans les domaines cités ci-dessous (exemples) --- \r\n    o	Mise en place d\'un serveur de streaming vidéo\r\n    o	Virtualisation (environnement RHEV)\r\n    o	Evaluation et comparaison de logiciels\r\n    o	Gouvernance, construction d’indicateurs \r\n\r\nActivités annexes :\r\n•	Maintenir et améliorer ses compétences par une formation continue\r\n•	Maintenir et mettre à jour la documentation du SIM\r\n•	Veille technologique\r\nRelations internes / externes au service :\r\n•	Participer aux réunions hebdomadaires du SIM et à d’autres séances de travail internes.\r\n'),(11559,5,389,'2017-05-12 12:12:18','XCL','Responsable de stage: Markus EIBL. Raison: Selon email de m. Rosset'),(11560,5,389,'2017-05-12 12:12:18','XCL','Responsable administratif du stage: Séverine ROY. Raison: Selon email de m. Rosset'),(11561,5,389,'2017-05-12 12:12:30','XCL','Responsable administratif du stage: Julien ROSSET. Raison: Selon email de m. Rosset'),(11562,2,176,'2017-05-12 12:14:47','XCL','Personne retirée de la liste'),(11563,5,383,'2017-05-12 12:16:47','XCL','Nouvel état: Confirmé. Raison: email de M. Ambiaux du 29.11.16'),(11564,4,708,'2017-05-15 10:01:48','PBA','Date fixée: 15.05.2017 17:00'),(11565,4,708,'2017-05-15 10:01:48','PBA','Status: OK'),(11566,4,708,'2017-05-15 15:33:09','PBA','Note: 5'),(11567,4,708,'2017-05-15 15:33:09','PBA','Rapport enregistré'),(11568,4,709,'2017-05-16 08:04:09','PBA','Date fixée: 10.07.2017 17:00'),(11569,4,709,'2017-05-16 08:04:09','PBA','Status: OK'),(11570,1,98,'2017-05-23 08:22:49','XCL','Ajouté place de stage (1.9.2017 - 31.1.2018). Raison: Email de M. Wüst'),(11571,5,421,'2017-05-23 08:23:24','XCL','Nouvel état: Confirmé. Raison: email de M. Wüst'),(11572,5,387,'2017-05-23 10:46:35','XCL','Descriptif du stage modifié: Le stagiaire a le rôle de technicien niveau 1, derrière un guichet ouvert non-stop de 10h à 17h du lundi\r\nau vendredi, il répond directement aux utilisateurs.\r\nLe helpdesk dispose de beaucoup de modèles de portables différents. Ceci permet de faire des\r\ndiagnostics de pannes matériels très poussés en croisant des pièces entre nos machines et celles de\r\nnos utilisateurs.\r\nDu stresstest en passant par les outils de diagnostics des fabricants aux outils open-sources ainsi que\r\ndiverses distributions GNU/Linux de dépannage, nous avons les moyens de venir à bout de toutes les\r\npannes.\r\nTrois postes de récupération de données sont régulièrement en fonction. Ils servent à cloner les disques\r\ndurs devenu illisibles et des outils spécialisés s’occupent de récupérer un maximum de données\r\nprécieuses. La ligne de commande GNU/Linux est un allié précieux dans cette tâche.\r\nIl est possible de suivre un/des cours offert par le sfp durant le stage'),(11573,1,30,'2017-05-23 10:47:25','XCL','Suppression du stage Sep 2018-Jan 2018'),(11574,5,393,'2017-05-24 12:55:01','XCL','Nouvel état: Confirmé. Raison: email de F. Merlet'),(11575,5,407,'2017-05-24 12:55:16','XCL','Nouvel état: Confirmé. Raison: email de F. Merlet'),(11576,5,395,'2017-05-24 12:56:14','XCL','Nouvel état: Confirmé. Raison: email de M. Tschudi'),(11577,5,395,'2017-05-24 12:56:14','XCL','Descriptif du stage modifié: Le stagiaire a le rôle de technicien niveau 1 au Service desk.\r\nIl est directement sous la responsabilité du Manager du Service desk.\r\nLe guichet du Service desk est ouvert de 10h à 12h et de 13h30 à 15h30.\r\nLe stagiaire est au contact des utilisateurs et leur répond directement en fonction des compétences qu’il va acquérir tout au long de son stage.\r\nL’ECAL possède un environnement informatique principalement lié à Mac OS X. Le stagiaire aura donc l’occasion d’acquérir des compétences avancées au sujet de ce système d’exploitation.\r\nLe stagiaire a la possibilité de réaliser durant son stage un projet lié à l’informatique ou à un des métiers enseignés à l’ECAL.'),(11578,5,395,'2017-05-24 12:56:49','XCL','Montant du salaire brut modifié: 1625'),(11579,1,111,'2017-05-29 13:56:34','XCL','Ajoutée à la liste d\'entreprises'),(11580,1,111,'2017-05-29 13:58:55','XCL','Ajouté place de stage (1.9.2017 - 31.1.2018). Raison: Contact téléphonique avec M. Normandin'),(11581,5,422,'2017-05-29 14:01:19','XCL','Responsable de stage: Alix NORMANDIN. Raison: 508 €'),(11582,5,422,'2017-05-29 14:01:19','XCL','Responsable administratif du stage: Ariane RIZOULIERES. Raison: 508 €'),(11583,5,422,'2017-05-29 14:02:52','XCL','Nouvel état: Accord de principe'),(11584,5,422,'2017-05-29 14:04:39','XCL','Téléphone avec M. Normandin. La mission semble adéquate (webmaster + gestion de projet de refonte du site), le cadre bon (équipe de ~20 personnes, 4 proches du stagiaire)'),(11585,5,422,'2017-05-29 14:06:03','XCL','Descriptif du stage modifié: Participer à la gestion de projet AMOA / AMOE\r\n- Participation à la refonte du site internet de la Ville de Marseille\r\n- Développement et intégration (HTML5/ CSS3, Javascript)\r\n- Participation au projet de création et de lancement d\'une application mobile (IOS, Android)\r\n- Pilotage des dossiers courants, en lien avec la DSI et les services\r\n- Mise à Jour et maintien des Bases de données\r\n- Maîtrise de différents CMS\r\n'),(11586,5,422,'2017-05-29 14:16:11','XCL','Montant du salaire brut modifié: 550. Raison: 508 €'),(11587,1,111,'2017-05-29 14:17:46','XCL','Place réservée à Jarod Streckeisen, qui l\'a amenée'),(11588,5,404,'2017-05-29 15:08:36','XCL','Nouvel état: Confirmé. Raison: email de M. Matter'),(11589,5,400,'2017-05-30 08:51:02','XCL','Nouvel état: Confirmé. Raison: Email de M. Noverraz'),(11590,5,380,'2017-05-30 08:58:26','PBA','Place attribuée à Gwendal MOTTAY'),(11591,5,353,'2017-05-30 08:59:36','PBA','Place libérée'),(11592,5,380,'2017-05-30 09:17:07','XCL','Place attribuée à Anthony FAUGERON'),(11593,5,380,'2017-05-30 09:17:07','XCL','Nouvel état: Signature Entreprise'),(11594,5,380,'2017-05-30 09:17:13','XCL','Nouvel état: Signature Doyen'),(11595,5,380,'2017-05-30 09:17:21','XCL','Nouvel état: Signé'),(11596,5,380,'2017-05-30 09:18:20','XCL','Nouvel état: Interrompu. Raison: Anthony a quitté le stage de son plein gré (problèmes relationnels) début mai'),(11597,1,97,'2017-05-30 09:20:07','XCL','Ajouté place de stage (01.06.2017 - 31.1.2018). Raison: Reprise du stage par G. Mottay'),(11598,5,423,'2017-05-30 09:20:25','XCL','Place attribuée à Gwendal MOTTAY'),(11599,5,353,'2017-05-30 09:22:16','XCL','Place attribuée à Gwendal MOTTAY'),(11600,5,353,'2017-05-30 09:23:10','XCL','Nouvel état