e deuxième niveau, Préparation des postes de travail, Coordination et répartition des requêtes des utilisateurs, Installation de logiciels et imprimantes, Gestion des commandes, Gestion des retours de marchandise, Gestion des iPads et Gestion du bon fonctionnement des salles d’étude.\r\n\r\nEn plus du salaire, les repas de midi ainsi que l\'accès à une salle de fitness sont offerts au stagiaire.\r\n\r\nBon niveau d\'anglais conseillé'),(12554,5,438,'2017-11-02 10:06:53','XCL','Nouvel état: Confirmé. Raison: Email de A. Thévenaz'),(12555,5,437,'2017-11-02 10:07:34','XCL','Nouvel état: Confirmé. Raison: Email de Armand Thévenaz'),(12556,5,437,'2017-11-02 10:07:34','XCL','Descriptif du stage modifié: Support Helpdesk dans un environnement international. Activités très variées:\r\n - Support de deuxième niveau\r\n - Préparation des postes de travail\r\n - Coordination et répartition des requêtes des utilisateurs\r\n - Installation de logiciels et imprimantes\r\n - Gestion des commandes\r\n - Gestion des retours de marchandise\r\n - Gestion des iPads\r\n - Gestion du bon fonctionnement des salles d’étude.\r\n - Participation à l’installation de matériel audiovisuel (caméra, micro, écran, etc.).\r\n - Préparation et installation de matériel pour Webinar\r\n - Participation au support audiovisuel dans des auditoires\r\n\r\nEn plus du salaire, les repas de midi ainsi que l\'accès à une salle de fitness sont offerts au stagiaire.\r\n\r\nBon niveau d\'anglais conseillé'),(12557,4,741,'2017-11-04 11:43:52','XCL','Note: 6'),(12558,4,741,'2017-11-04 11:43:52','XCL','Rapport enregistré'),(12559,4,741,'2017-11-04 11:43:52','XCL','5.9->6.0'),(12560,5,455,'2017-11-06 09:13:02','XCL','Descriptif du stage modifié: Stage d’informaticien dans le support informatique ainsi que de la gestion.\r\n\r\nLe stagiaire devra participer à la finalisation de la mise en place du nouvel ERP sage X3, notamment :\r\n\r\n-        Création d’états avec Crystal report\r\n-        Formation des utilisateurs finaux\r\n-        Personnalisation et création de requêtes métier\r\n\r\nIl devra assister les utilisateurs , implémenter et maintenir nos serveurs physiques et virtuels sous VMware dans un contexte AD et Exchange.\r\n'),(12561,5,455,'2017-11-06 09:13:23','XCL','Nouvel état: Confirmé. Raison: Email d\'Anthony Faugeron'),(12562,5,455,'2017-11-06 09:13:37','XCL','Montant du salaire brut modifié: 1400'),(12563,5,425,'2017-11-06 09:15:54','XCL','Nouvel état: Signature Entreprise'),(12564,5,425,'2017-11-06 09:16:25','XCL','Nouvel état: Signature Doyen. Raison: Email de Kevin: il a envoyé les documents par poste vendredi'),(12565,5,435,'2017-11-06 12:30:49','XCL','Nouvel état: Confirmé. Raison: lors de ma visite à Alexandre G'),(12566,5,452,'2017-11-06 12:31:01','XCL','Nouvel état: Confirmé. Raison: lors de ma visite à Alexandre G'),(12567,5,444,'2017-11-06 12:31:33','XCL','Nouvel état: Confirmé. Raison: lors de ma visite à Stuart'),(12568,5,449,'2017-11-06 22:02:13','PBA','Nouvel état: Confirmé'),(12569,1,38,'2017-11-07 10:17:16','XCL','Ajouté place de stage (1.2.2018 - 31.8.2018). Raison: Email de Nathalie Naegele'),(12570,5,456,'2017-11-07 10:19:07','XCL','Descriptif du stage modifié: Stage dans le service IT.\r\n\r\nSupport de deuxième niveau aux utilisateurs, installation, configuration, maintenance et supervision des postes de travail.'),(12571,5,456,'2017-11-07 10:19:57','XCL','Montant du salaire brut modifié: 1400. Raison: Montant uniformisé chez NagraVision'),(12572,5,456,'2017-11-07 10:20:55','XCL','Responsable de stage: Nathalie NAEGELE. Raison: nouveau stage'),(12573,5,456,'2017-11-07 10:20:55','XCL','Nouvel état: Confirmé. Raison: nouveau stage'),(12574,2,345,'2017-11-07 12:41:06','RAZ','Souhait (rang 1) pour le stage NagraVision (Kudelski)'),(12575,5,445,'2017-11-07 12:41:06','RAZ','Souhait (rang 1) de Roderick ANGELOZ'),(12576,5,445,'2017-11-07 12:41:07','RAZ','Souhait de Roderick ANGELOZ retiré'),(12577,2,345,'2017-11-07 12:41:07','RAZ','Suppression du