ise en service).\r\nL’équipe est souvent très prise. C’est pourquoi le triangle des compétences requis pour ce stage est : l’autonomie, la débrouillardise et la motivation.',NULL,1),(64,40,'2013-02-01 00:00:00','2013-08-30 00:00:00',58,59,29,13,NULL,'',NULL,1),(65,40,'2013-09-02 00:00:00','2014-01-31 00:00:00',58,59,29,13,64,'',NULL,1),(66,41,'2013-02-01 00:00:00','2013-08-30 00:00:00',47,71,22,13,NULL,'',NULL,1),(67,41,'2013-09-02 00:00:00','2014-01-31 00:00:00',47,71,23,13,66,'',NULL,1),(68,42,'2013-09-02 00:00:00','2014-01-31 00:00:00',73,72,25,13,33,'',NULL,1),(69,43,'2013-02-01 00:00:00','2013-08-30 00:00:00',44,51,23,13,NULL,'',NULL,1),(70,43,'2013-09-02 00:00:00','2014-01-31 00:00:00',44,51,19,13,69,'',NULL,1),(71,45,'2013-02-01 00:00:00','2013-08-30 00:00:00',44,44,24,13,NULL,'',NULL,1),(72,45,'2013-09-02 00:00:00','2014-01-31 00:00:00',44,44,17,13,71,'Support, installation, dépannage',NULL,1),(73,46,'2013-09-02 00:00:00','2014-01-31 00:00:00',56,56,20,13,35,'',NULL,1),(74,47,'2013-09-02 00:00:00','2014-01-31 00:00:00',109,77,18,13,36,'Support, installation, dépannage',NULL,1),(75,48,'2013-02-01 00:00:00','2013-08-30 00:00:00',64,64,26,13,NULL,'',NULL,1),(78,38,'2013-09-02 00:00:00','2014-01-31 00:00:00',81,65,41,13,30,'Programmation d\'un microcontrolleur pour un minidisplay qui doit être intégré dans un émulateur.',NULL,1),(82,48,'2013-09-02 00:00:00','2014-01-31 00:00:00',64,64,26,13,75,'',NULL,1),(84,38,'2013-09-02 00:00:00','2014-01-31 00:00:00',98,65,27,13,NULL,'Implémentation de workflow de commande de cartes à puce sur du SharePoint avec l’outil de design NINTEX.<br>\r\nLe process est défini; Le workflow comporte plusieurs chemins possibles et une dizaine d’étape sur le chemin standard. Les actions peuvent être lancées par e-mail.',NULL,1),(85,44,'2013-09-02 00:00:00','2014-01-31 00:00:00',82,50,28,13,34,'',NULL,1),(91,66,'2013-09-01 00:00:00','2014-01-31 00:00:00',106,105,36,13,NULL,'Réalisation d\'une application passerelle entre ArcGIS et MISTRA.\