ls',NULL,1),(112,37,'2014-02-01 00:00:00','2014-08-31 00:00:00',70,169,116,13,58,'',NULL,1),(113,26,'2014-02-01 00:00:00','2014-08-31 00:00:00',78,182,143,13,41,'Sur le site de Marcelin à Morges se côtoient plusieurs écoles : CEPM, Gymnase de Morges, Agrilogie et CEMEF. Le CEPM (Centre d’enseignement professionnel de Morges) est un centre d’enseignement des professions dans le domaine de la construction.\r\nLe service informatique du CEPM s’occupe de tout le parc informatique Windows du site de Marcelin, qui comporte environ 650 ordinateurs (500 Windows et 150 Macs), une infrastructure VMware sur des serveurs ESX, un réseau câblé Gigabit avec des switches Cisco et un réseau Wireless avec l’équipement Ruckus et maintenance des ordinateurs ainsi que déploiement des applications avec Impero.\r\nLe stagiaire collabore avec une personne du service IT qui est employé à 100% et les tâches sont les suivantes :\r\n•	Développement d’applications en PHP, MySQL, C#, Java (Android), LDAP (AD)\r\n•	Installation, configuration et maintenance des postes de travail fixes et portables (PC)\r\n•	Installation, configuration et maintenance des imprimantes et photocopieuses réseau et locales\r\n•	Gestion des Backup\r\n•	Gestion des toners d’impression\r\n•	Déploiement des images et des logiciels (WDS)\r\n•	Création et gestion des comptes informatiques dans Active Directory\r\n•	Support aux utilisateurs\r\nLe stagiaire a un bureau à sa disposition et travaille dans un environnement agréable. Les commodités à dispositions sont :\r\n•	Deux cafétérias et un stand\r\n•	Transports publics à proximité\r\n',NULL,1),(114,30,'2014-02-01 00:00:00','2014-08-31 00:00:00',156,60,130,13,47,'',NULL,1),(115,39,'2014-02-01 00:00:00','2014-08-31 00:00:00',61,61,123,13,32,'Support de 1er et 2ème niveau\r\n\r\nDéploiement et support informatique sous différents environnements (Windows , iOS, Android, etc.). \r\n \r\nContact téléphonique avec les fournisseurs.\r\n\r\nUtilisation d’un système de ticketing afin de répertorier les différents incidents.\r\n\r\nContact direct avec les collaborateurs et résolutions de problème depuis le bureau d’accueil (Welcome Desk).\r\n\r\nIntervention sur site pour le support informatique ou les remplacements de matériel.\r\n\r\nPossibilité d’avoir du temps libre pour la réalisation d’un projet. \r\n\r\nPréparation de vidéoconférence depuis différents systèmes (téléphone Cisco, Bridge…).',NULL,1),(116,50,'2014-02-01 00:00:00','2014-08-31 00:00:00',166,166,125,13,NULL,'Helpdesk pour un parc de PC et Mac\r\nBon niveau d\'anglais nécessaire (école internationale)',NULL,1),(119,35,'2014-02-01 00:00:00','2014-08-31 00:00:00',150,62,138,13,55,'',NULL,1),(121,55,'2014-02-01 00:00:00','2014-08-31 00:00:00',92,89,126,13,NULL,'',NULL,1),(122,37,'2014-02-01 00:00:00','2014-08-31 00:00:00',70,169,137,14,60,'',NULL,1),(127,70,'2014-09-01 00:00:00','2015-01-31 00:00:00',146,NULL,115,13,NULL,'-         Support informatique aux utilisateurs interne\r\n-         Réalisation de scripts PHP (sous linux)\r\n-         Configuration réseaux (wifi / firewall / switchs …)\r\n-         Réalisation de pages web (PHP / HTML5)\r\n-         Après formation interne, dépannage réseau chez des clients (firewall / wifi / …)',NULL,1),(128,71,'2014-02-01 00:00:00','2014-08-31 00:00:00',174,147,117,13,NULL,'Helpdesk\r\nInstallation de postes\r\nMigration de postes',NULL,1),(129,71,'2014-02-01 00:00:00','2014-08-31 00:00:00',174,147,129,13,NULL,'Helpdesk\r\nInstallation de postes\r\nMigration de postes',NULL,1),(131,42,'2014-02-01 00:00:00','2014-08-31 00:00:00',154,72,120,13,68,'',NULL,1),(132,42,'2014-09-01 00:00:00','2015-01-31 00:00:00',154,190,133,13,131,'',NULL,1),(133,46,'2014-09-01 00:00:00','2015-01-31 00:00:00',56,155,127,13,98,'',NULL,1),(134,38,'2014-02-01 00:00:00','2014-08-31 00:00:00',80,65,141,13,103,'L’équipe « Integration & Development » est composée de 5 ingénieurs et d’un Team Leader. Elle est sollicitée pour tout type de développement en interne que ce s