INSERT INTO `statuscontrat` VALUES (1,'Idée',0,'Le maître principal (MP) contacte l’entreprise et évalue la pertinence de l‘idée : L’environnement de travail est-il bon ? L’entreprise pourra-t-elle fournir un encadrement adéquat ? Les missions confiées au stagiaire sont-elles adaptées ? Sont-elles variées ? Le principe de la rémunération et les différences entre CFC et MPT sont-ils acceptables ?',0),(2,'Reconduit',0,'Le stage est listé dans la page « souhaits » de l’application. Les élèves peuvent émettre leur souhait de faire ce stage.\rDébut novembre pour février ou début juin pour septembre,  le vote est clos. Les maîtres de classe (MC) et le MP procèdent à l’attribution des places en fonction des souhaits, des attentes des entreprises, des compétences des élèves et des distances entre le domicile et le lieu de travail. \rChaque élève postule pour la ou les place(s) attribuée(s). Une postulation consiste en un CV et une lettre au format pdf envoyé par email à la ou les personne(s) responsable(s) du stage dans l’entreprise, avec copie au MC. ',1),(3,'Considération',0,'(obsolet)',0),(4,'Accord de principe',0,'La personne consultée ne pouvant pas prendre de décision formelle, elle regarde en interne s’il est possible de prendre un stagiaire.',0),(5,'Rejeté',0,'(obsolet)',0),(6,'Confirmé',0,'Le stage est listé dans la page « souhaits » de l’application. Les élèves peuvent émettre leur souhait de faire ce stage.\rDébut novembre pour février ou début juin pour septembre,  le vote est clos. Les maîtres de classe (MC) et le MP procèdent à l’attribution des places en fonction des souhaits, des attentes des entreprises, des compétences des élèves et des distances entre le domicile et le lieu de travail. \rChaque élève postule pour la ou les place(s) attribuée(s). Une postulation consiste en un CV et une lettre au format pdf envoyé par email à la ou les personne(s) responsable(s) du stage dans l’entreprise, avec copie au MC. ',1),(7,'Attribué',0,'(obsolet)',1),(8,'Rédaction contrat',0,'L’élève prépare le contrat et le soumet au doyen',0),(9,'Signature Doyen',0,'Le doyen signe les trois exemplaires',0),(10,'Signature Entreprise',0,'Les trois exemplaires signés par l’élève sont dans les mains de l’entreprise, qui procède à leur signature et les rendent à l’élève.',0),(11,'Annulé',0,'(obsolet)',0),(12,'Signé',1,'Le stage est en cours',0),(13,'Effectué',0,'Le stage s’est terminé normalement. Le processus se termine là en ce qui concerne cette place de stage. Ce stage peut servir de modèle de base pour une nouvelle place plus tard.',0),(14,'Interrompu',0,'A l’un ou l’autre moment durant le stage, l’une des parties a décidé d’y mettre un terme. Le processus se termine là en ce qui concerne cette place de stage. Ce stage peut servir de modèle de base pour une nouvelle place plus tard.',0);
